window.bookSummaryJSON = "<p><b>I will destroy all threats to the empire with unrelenting force. Even if that threat comes in the form of a weak, fragile lesser with night-black hair and beguiling eyes.</b></p> <p>The blades. Elite forces of the empire, nightmare to all servant-world residents just trying to scrape by. Of course I have to flee when my medical ship comes under attack.</p> <p>But my escape pod is captured by their ruthless leader.</p> <p>His face is hidden in an assassin’s cowl. Metal sai weapons are fused to his wristbones. He can fly between spaceships like an owl and execute enemies through a hull.</p> <p>Yet according to him, <i>I’m</i> the dangerous one.</p> <p>His people’s lust metal has gotten in my blood. They’ll tear each other apart trying to get to me. And then? Because they can’t understand their feelings, they’ll tear me apart, too.</p> <p>So he’s taking me to the Arsenal, a massive station teeming with his blades, where I’m one papercut away from unleashing hyperviolent zombie hordes.</p> <p>Well, okay.</p> <p>I’m lucky he’s the one who captured me. He senses the lust metal inside me, he understands the desires burning us both with unrelenting need, and he’s <i>completely </i>unaffected.</p> <p>Or, well, mostly....</p> <p>Contains unique alien shifters, fierce passion, and loyal warriors who find their fated mates in the stars. Each full-length book is a complete romance with an epic happily-ever-after. Claim your conqueror today!</p>"; 
